import axios from 'axios';

export function gitProfile(username){
    console.log(username);
    return async dispatch => {
        try {
            const response = await axios.get(`https://api.github.com/users/${username}`);
            dispatch({
                type: "GET_GITHUB_INFO",
                payload: response
            });
        }
        catch (error) {
            throw (error);
        }
    }
}
